import { useState } from "react";
import DateTimePicker from 'react-datetime-picker';

function Todo(){
    const [dueTime, setDueTime] = useState(new Date);
    return (
        <div>
            <DateTimePicker
                renderInput={(props) => <TextField {...props} />}
                label="DateTimePicker"
                value={value}
                onChange={setDueTime}
            />
            <p>{dueTime}</p>
        </div>
    );
}

export default Todo
